import React from "react";
import "./style.css";

function FriendCard(props) {
  return (
    <div className="container images">
      <div className="row">
        <div className="col col-sm-3">
          <img alt={props.name} src={props.image}
            onClick={() => props.handleClick(props.id)}
          />
        </div>
      </div>
    </div>
  );
}

export default FriendCard;
